        function dist(a,b) {
            var dx=a[0]-b[0];
            var dy=a[1]-b[1];
            return dx*dx+dy*dy;
        }

        function focusNearest() {
            if(!navigator.geolocation) {
                alert("Геолокация не поддерживается");
                return;
            }
            navigator.geolocation.getCurrentPosition(function(pos){
                var u=[pos.coords.latitude,pos.coords.longitude];
                var best=0;
                var bestD=dist(u,SP_POINTS[0]);
                for(var i=1;i<SP_POINTS.length;i++){
                    var d=dist(u,SP_POINTS[i]);
                    if(d<bestD){bestD=d;best=i;}
                }
                var t=SP_POINTS[best];
                MAP.flyTo([t[0],t[1]],16);
                L.popup().setLatLng([t[0],t[1]]).setContent("Ближайшая улица " + SP_POINTS[0]).openOn(MAP);
            },function(err){alert("Ошибка геопозиции: "+err.message);},
            {enableHighAccuracy:true});
        }

        var btn=document.createElement("button");

        btn.style.borderRadius="6px";
        btn.style.zIndex=99999;
